import React, { Component } from 'react';

class App extends Component {
    componentDidMount() {
        fetch("https://www.bitstamp.net/api/v2/trading-pairs-info")
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        isLoaded: true,
                        items: result.items
                    });
                },
                (error) => {
                    this.setState({
                        isLoaded: true,
                        error
                    });
                }
        )
    }
    render() {

    };
}

export default App;
